class header extends React.Component {
  render() {
    return (
      <nav class="navbar navbar-light custom-navbar">
        <div class="container">
          <a class="navbar-brand" href="index.html">
            Carl Leandersson
            <br />
            Portfolio
          </a>
          <div id="filters" class="filters">
            <a href="#aboutme">About me</a>
          </div>
        </div>
      </nav>
    );
  }
}

export default header;
